  input: TEXT,F3XA,,"Line 17 includes receipts from Media Unitemized totalling $7,025.00
    received from various media outlets for rental of space during the Iowa caucuses.
    None of these receipts were from an individual, and no media organization paid
    $200 or more for this service. Amounts received from Individual Unitemized include
    $309.82 from the sale of T-shirts, reported on Line 17, $120,633.37 from participants
    in the Iowa precinct caucuses, and other amounts of less than $20 each from direct
    mail responders, all reported on Line 11(a). No amounts were received in excess
    of $50 from any individual. Line 22 discloses $112,895.28 transfered to the committee's
    non-federal account for cash flow purposes. The transfered amounts were used for
    non-federal, non-allocable expenses, principally payroll. All administrative expenses
    paid by the committee during the period have been reported herein as allocable
    expenses on Line 21(a). The federal portion of such expenses are allocated at
    36%."
